def generate_nameplate(handle: str) -> (int, int, list):
    for i in range(2, 6):
        vst = len(handle) // i
        ost = len(handle) % i
        if vst + min(ost, 1) > 20:
            continue
        a = [[] for _ in range(i)]
        ind = 0
        f = 0
        for j in range(i):
            for k in range(vst):
                a[j].append(handle[ind])
                ind += 1
            if ost > 0:
                ost -= 1
                a[j].append(handle[ind])
                ind += 1
                f = 1
            elif f != 0:
                a[j].append('*')
        if a[-1][-1] == '*' or a[-1][-1] == handle[-1]:
            rows = len(a)
            columns = len(a[0])
            table = [''.join(row) for row in a]
            return (rows, columns, table)
    return None

